import React, { useState } from "react";
import Windows from './Windows.tsx'

const PC = ({handleClose}) => {
  const [loggedIn, setLoggedIn] = useState(false);

  if (!loggedIn)
  return (
    <div id="pc">
      <div id="loading-screen">
      <div></div>
        <img id="winblows-logo" src="/winblows logo.png"></img>
        <div>
          <input style={{
            width: '160px',
            backgroundColor: "lightblue"
          }} placeholder="username" type="text"></input>
          <br/>
          <input style={{
            backgroundColor: "lightblue",
            fontWeight: 'bold',
            width: '160px'
          }} value="Login" type="button" onClick={()=>setLoggedIn(true)}></input>
        </div>
        <div></div>
        <div></div>
      </div>
    </div>
  )

  return <div id="pc">
    <Windows handleClose={handleClose} />
  </div>
}

export default PC;
